import React, {useState} from 'react';
import '../styles.css';
import PageSetup from '../components/pageSetup';
import Container from 'react-bootstrap/Container';
import {useLocation} from 'react-router-dom';

const ShoppingCartView = () => { 
    const {state} = useLocation();
    const { titulo, prodPrice, prodUnits } = state;

    return(<PageSetup generalTitle="Raide Energy" pageTitle="Carrito de Compras">
        <Container style={{top: "45vh", position: "relative", display: "block", border: "2px solid black",
            borderRadius: "15px"}}>
            <Row>
                <Col>{titulo}</Col>
                <Col>{prodPrice}</Col>
                <Col> {prodUnits}</Col>
            </Row>
          
            <br/>
            {"Hola como va"}
            <div style={{textAlign: "left", paddingTop: "20px", paddingLeft: "50px", position: "relative",
                fontSize: "20px",}}>
                {"Cel: +54 011 6205 9438"}<br/>{"Mail: zudairejosefrancisco@gmail.com"}
            </div>
        </Container>
    </PageSetup>) 
}

export default ShoppingCartView;
